  var generatedArray = [];
  var objectByLevel = {};
  var topLevel = 1;
  var ui_asset_types;
    
  function getHighestLevel(){
    for (var prop in jData) { 
          if(!jData.hasOwnProperty(prop)) continue;  
          if(jData[prop].info.assetlevel > topLevel){
            topLevel = jData[prop].info.assetlevel; 
          }
      }       
  }

  function setLeveledArray(){ 
    var asset_find = false;
    ui_asset_types = [];

    // Check for asset types
    for (var prop in jData) { 
        if(!jData.hasOwnProperty(prop)) continue;   
        asset_find = false;
        for(var i=0; i < ui_asset_types.length; i++){
          if(jData[prop].info.ui_asset_type == ui_asset_types[i]) asset_find = true;
        }
        if(!asset_find){
          ui_asset_types.push(jData[prop].info.ui_asset_type); 
        }
    }     

      // dividing array by level
    for(var i = topLevel; i > 0; i--){  

      // setting default object
      objectByLevel[i] = {}; 
      for(var j=0; j<ui_asset_types.length; j++){
        objectByLevel[i][ui_asset_types[j]] = [];
      }

      // pushing element into respective level and ui_asset_type;
      for (var prop in jData) { 
            if(!jData.hasOwnProperty(prop)) continue;  
            if(jData[prop].info.assetlevel == i){ 
              objectByLevel[i][jData[prop].info.ui_asset_type].push(jData[prop]); 
            }
        }           
    }
  }
        
  function generateArray(){
    // setting default object
    var tempEl;
    var tempElG;
    var tempGA2 = {};  
    for(var j=0; j<ui_asset_types.length; j++){
      tempGA2[ui_asset_types[j]] = [];
    }
    var tempGArray = objectByLevel[topLevel];

    //The magic loop
    for(var i=topLevel-1; i > 0; i--){
      tempGA2 = objectByLevel[i];
      for(var j=0; j < ui_asset_types.length; j++){ 
        for(var k=0; k < tempGA2[ui_asset_types[j]].length; k++){
          tempEl = tempGA2[ui_asset_types[j]][k];
          if(tempEl.children != null && tempEl.children != undefined != tempEl.children.length > 0){
            tempEl.children = {} 
            for(var q=0; q<ui_asset_types.length; q++){
              tempEl.children[ui_asset_types[q]] = [];
            }
            for(var l=0; l < ui_asset_types.length; l++){   
              tempElG = tempGArray[ui_asset_types[l]];
              for(var m=0; m < tempElG.length; m++){
                if(tempEl.info.groupid == tempElG[m].info.pgroupid){
                  tempEl.children[ui_asset_types[l]].push(tempElG[m]); 
                }
              }
            }
          }
          tempGA2[ui_asset_types[j]][k] = tempEl; 
        }
      }
      tempGArray = tempGA2; 
    }
    return tempGArray;
  }

  function generateUIJson(){
    getHighestLevel();
    setLeveledArray();
    return generateArray();
  }

  $scope.data = generateUIJson();

